import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import "bootstrap/dist/css/bootstrap.min.css";

import CreateTodo from "./components/projects.component.js";
import EditTodo from "./components/about.component.js";
import TodosList from "./components/contact.component.js";
import Header from "./components/header.component.js"

class App extends Component {
  render() {
    return (
      <Router>
        <div className="container">
          <Header/>
          <br/>
          <Route path="/about" exact component={TodosList} />
          <Route path="/contact" component={EditTodo} />
          <Route path="/projects" component={CreateTodo} />
        </div>
      </Router>
    );
  }
}

export default App;
